import "./App.css";
import Navbars from "./components/Navbar";
import Cart from "./components/Cart";
import Home from "./components/Home";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Navbars />
        <Routes />
      </Router>
    </div>
  );
}

export default App;
